Sample Prompt:
Example_1:
input: ['g', 'g', 'g', '.', '.', '.', '.']
output: ['.', 'g', 'g', 'g', '.', '.', '.']

Example_2:
input: ['c', 'c', 'c', '.', '.', '.', '.']
output: ['.', 'c', 'c', 'c', '.', '.', '.']

Example_3:
input: ['h', 'h', 'h', '.', '.', '.', '.']
output: ['.', 'h', 'h', 'h', '.', '.', '.']

Test case:
input: ['e', 'e', 'e', '.', '.', '.', '.']

###########################################################
Sample Outputs:
output: ['.', 'e', 'e', 'e', '.', '.', '.']
*/

public class Solution {
    public String move(String s) {
        if (s == null || s.length() <= 1) return s;
        char[] arr = s.toCharArray();
        int i = 0, j = 0;
        while (i < arr.length && j < arr.length) {
            if (arr[j]!= '.') {
                swap(arr, i++, j);
            }
            j++;
        }
        return new String(arr);
    }

    private void swap(char[] arr, int a, int b) {
        char tmp = arr[a];
        arr[a] = arr[b];
        arr[b] = tmp;
    }
}
